var StroopExperiment = function() {

	psiTurk.recordUnstructuredData("mode", mode);

	var wordon;

	//Mengmi: generate random image list
	totalImageShown = 50;
	var imagelist = [];
	var imagenamelist = [];
	var trialindex =-1;

	imagenum = _.shuffle(imagenum)

	for (i = 0; i < totalImageShown; i++) {

		var imagename = imagenum[i];
		imagenamelist.push(imagename);
		var imagelink = "https://xiaoturing.s3.us-east-1.amazonaws.com/color_det/" + imagename + ".jpg";
		imagelist.push(imagelink)
	}
	psiTurk.preloadImages(imagelist);
	console.log(imagelist)

	// Stimuli for a basic Stroop experiment
	psiTurk.recordUnstructuredData("condition", condition);

	var next = function() {
		if (imagelist.length===0) {
			finish();
		}
		else {
			trialindex = trialindex+1;
			current_img = imagelist.shift();
			current_img_name = imagenamelist.shift();
			console.log(current_img)

			// human_machine = _.shuffle(human_machine)
			

			random_flip = _.shuffle(random_flip)
			d3.select("#stim").html('<img src='+current_img+' alt="stimuli" height="512">')


			if (random_flip[0] == 0){
				d3.select("#stim2").html('<b> Does this image contain the following - "' + oneWord[current_img] + '"? </b> <input type="hidden" name="oneWord_curr" id="hiddenInput" value="0" />')
			}
			else{
				d3.select("#stim2").html('<b> Does this image contain the following - "' + wrongWord[current_img] + '"? </b> <input type="hidden" name="oneWord_curr" id="hiddenInput" value="1" />' )
			}
			wordon = new Date().getTime();


		}
	};

	var finish = function() {
	    //$("body").unbind("keydown", response_handler); // Unbind keys
	    currentview = new Questionnaire();
	};


	// Load the stage.html snippet into the body of the page
	// psiTurk.showPage('prequestionairre.html')
	psiTurk.showPage('stage.html');

	// Register the response handler that is defined above to handle any
	// key down events.
	//$("body").focus().keydown(response_handler);

	// Start the test; initialize everything
	next();
	document.getElementById("submittrial").addEventListener("click", mengmiClick);

	function mengmiClick()
	{
		// var Aclass = document.querySelector('input[type="radio"][name="Aclass"]:checked').value;
		// var Agender = document.querySelector('input[type="radio"][name="Agender"]:checked').value;
		// var topic = document.querySelector('input[type="radio"][name="topic"]:checked').value;
		var oneWord_curr = document.querySelector('input[type="hidden"][name="oneWord_curr"]').value;
		// var page_name = document.querySelector('input[type="hidden"][name="page_name"]').value;

		var response_speaker = "";
		var response_object = "";
		// var speaker_human = document.getElementById("human");
		// var speaker_machine = document.getElementById("machine");
		// var object_dummy_yes = document.getElementById("topic1");
		// var object_dummy_no = document.getElementById("topic2");
		

		response_speaker = document.getElementById('color').value;
		

		if (document.getElementById('topic1').checked) {
			response_object = document.getElementById('topic1').value;
		}
		else if(document.getElementById('topic2').checked) {
			response_object = document.getElementById('topic2').value;
		}


		var rt = new Date().getTime() - wordon;
		if ((response_speaker.length > 0) && (response_object.length > 0) && rt >= 2000){
			document.getElementById("topic1").checked = false;
			document.getElementById("topic2").checked = false;
			// document.getElementById('color').
			var elements = document.getElementById("color").options;

			for(var i = 0; i < elements.length; i++){
				elements[i].selected = false;
			}
			psiTurk.recordTrialData({'phase':"TEST",
									'imageID':current_img, //image name presented
									'oneWord_curr': oneWord_curr,
									'topic':response_object,
									'color':response_speaker, //worker response for image name
									'hit':imagenum[trialindex], //index of image name
									'rt':rt, //response time
									'trial': trialindex+1, //trial index starting from 1
									}
								);
			next();
			}
		else{
			if (rt < 2000) {
				window.alert("Warning: Please view the image and read the question carefully!!");
			}
			if ((response_speaker.length === 0) || (response_object.length ===0)){
	    	window.alert("Warning: Please choose a response for each question before submitting!");			
			}
		}
	    
	}
};


